import React from 'react';
import Button from '../Button';
import Input  from '../Input';
import Divider from '../Divider';
import styled from 'styled-components';

const WelcomeCont = styled.div`
    display: flex;
    flex-direction: column;
    h1{
        filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
        font-family: sans-serif;
    }
`;

const ForgotCont = styled.p`
    color: #4285F4;
    position: relative;
    left:55%;
    font-family: sans-serif;
    font-size:10px;
`;

const Welcome = ({}) => {
    return <WelcomeCont>
        <h1 >Welcome Back!</h1>

        <Button text='Login with Google' radius='0px' google ></Button>

        <Divider/>

        <Input text='EMAIL' PHtext='joe@gmail.com'></Input>

        <Input text='PASSWORD' PHtext='••••••••••••••••'></Input>

        <ForgotCont>Forgot password?</ForgotCont>

            <Button text='Login'></Button>

            <Button text='Signup' bgcolor='#D79B9B'></Button>

    </WelcomeCont>
}

export default Welcome;
